import React from "react";
import PropTypes from "prop-types";

//json
import CollectionData from "../Data/Collection.json";

//css
import "../Css/Collection.css";

function Collection() {
    const collectionData = CollectionData;
    const collection2025 = CollectionData.Collection_2025;
    const collectionImg = collection2025[10].url;

    return (
        <div className="collection-wrap">
            <p className="collection-h1">Collection</p>
            <div className="collection-img">{/* <img src={collection2025[10].url} alt="collection-img"></img> */}</div>
        </div>
    );

}



export default Collection;
